            new ExerciseDataAccessModel(54, 106, "STOP - 90º højre om – STOP", "Teamet stopper, og hunden sætter sig i venstrepositionen. Derefter drejer teamet, på stedet 90° til højre. Hunden følger med og holder sin venstreposition, sætter sig igen hvorefter teamet fortsætter til næste øvelse. Højrehandling gennemføres også til højre. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(55, 107, "STOP - 90º venstre om - STOP", "Teamet stopper, og hunden sætter sig i venstrepositionen. Derefter drejer teamet, på stedet 90° til venstre. Hunden følger med og holder sin venstreposition, sætter sig igen, hvorefter teamet fortsætter til næste øvelse. Højrehandling gennemføres også til venstre. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(56, 108, "STOP - højre om - 1 skridt - kald på plads – STOP", "Teamet stopper, og hunden sætter sig i venstrepositionen. Hunden dirigeres til at blive siddende, mens føreren drejer til højre og derefter tager et skridt og stopper. Hunden, der dirigeres, skal gå til venstrepositionen og sætte sig, hvorefter teamet fortsætter til næste øvelse. Højrehandling gennemføres også til højre. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(57, 109, "STOP - venstre om - 1 skridt - kald på plads - STOP", "Teamet stopper, og hunden sætter sig i venstrepositionen. Hunden dirigeres til at blive siddende, mens føreren drejer til venstre og derefter tager et skridt og stopper. Hunden, der dirigeres, skal gå til venstrepositionen og sætte sig, hvorefter teamet fortsætter til næste øvelse. Højrehandling gennemføres også til venstre. Hunden fortsætter i højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(58, 110, "STOP - højre omkring - fremad", "Teamet stopper, og hunden sætter sig i venstrepositionen. Derefter drejer teamet 180° højre rundt på stedet og bevæger sig direkte fremad. Højrehandling gennemføres også til højre. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(59, 111, "STOP - venstre omkring - fremad", "Teamet stopper, og hunden sætter sig i venstrepositionen. Derefter drejer teamet 180° venstre rundt på stedet og bevæger sig direkte fremad. Højrehandling gennemføres også til venstre. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(60, 112, "STOP - højre omkring - STOP", "Teamet stopper, og hunden sætter sig i venstrepositionen. Derefter drejer føreren på stedet 180° til højre. Hunden følger med og holder sin venstreposition. Hunden sætter sig igen, hvorefter teamet fortsætter til næste øvelse. Højrehandling gennemføres også til højre. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(61, 113, "STOP - venstre omkring - STOP", "Teamet stopper, og hunden sætter sig i venstrepositionen. Derefter drejer føreren på stedet 180° til venstre. Hunden følger med og holder sin venstreposition. Hunden sætter sig igen, hvorefter teamet fortsætter til næste øvelse. Højrehandling gennemføres også til venstre. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(62, 114, "STOP - 1 sideskridt til højre - STOP", "Teamet stopper efter skiltet, og hunden sætter sig i venstrepositionen. Føreren træder 1 sideskridt lige til højre (uden at ændre retning). Hunden følger med og holder sin venstreposition, sætter sig igen, hvorefter teamet fortsætter til næste øvelse. Højrehandling gennemføres også til højre. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(63, 115, "STOP - 1 sideskridt til venstre - STOP", "Skiltet holdes på venstre side. Teamet stopper efter skiltet, og hunden sætter sig i venstrepositionen. Føreren træder 1 sideskridt lige til venstre (uden at ændre retning). Hunden følger med og holder sin venstreposition, sætter sig igen, hvorefter teamet fortsætter til næste øvelse. Højrehandling gennemføres også til venstre. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(64, 116, "STOP - 2 sideskridt til højre - STOP", "Teamet stopper efter skiltet, og hunden sætter sig i venstrepositionen. Føreren træder 2 sideskridt lige til højre (uden at ændre retning). Hunden følger med og holder sin venstreposition, sætter sig igen, hvorefter teamet fortsætter til næste øvelse. Kan ikke udføres i højrehandling.", DefaultHandlingPositionEnum.Left, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(65, 117, "STOP - 2 sidekridt til venstre - STOP", "Teamet stopper efter skiltet, og hunden sætter sig i højrepositionen. Føreren træder 2 sideskridt lige til venstre (uden at ændre retning). Hunden følger med og holder sin højreposition, sætter sig igen, hvorefter teamet fortsætter til næste øvelse. Kan kun udføres i højrehandling.", DefaultHandlingPositionEnum.Right, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(66, 118, "2 sideskridt til højre", "Øvelsen udføres efter skiltet. Føreren træder 2 sideskridt lige til højre (uden at ændre retning). Hunden følger med og holder sin venstreposition, hvorefter teamet fortsætter til næste øvelse. Denne øvelse er under gang og uden opstandsning. Kan ikke udføres i højrehandling.", DefaultHandlingPositionEnum.Left, false, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(67, 119, "2 sideskridt til venstre", "Øvelsen udføres efter skiltet. Føreren træder 2 sideskridt lige til venstre (uden at ændre retning). Hunden følger med og holder sin højreposition, hvorefter teamet fortsætter til næste øvelse. Denne øvelse er under gang og uden opstandsning. Kan kun udføres i højrehandling.", DefaultHandlingPositionEnum.Right, false, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(68, 120, "STOP - sit foran - bagom - STOP", "Teamet stopper, og hunden sætter sig i venstrepositionen. Derefter dirigerer føreren hunden ind foran sig, hvor hunden sætter sig (med front mod føreren). I øvelsens anden del dirigeres hunden til venstrepositionen ved at gå bag om føreren. Først når hunden sidder i venstreposition, går teamet atter fremad. Føreren må ikke flytte sig for at hjælpe hunden under øvelsen. Højrehandling gennemføres ved, at hunden dirigeres ind foran, hvor den sætter sig foran føreren, og afsluttes ved at hunden går bag om føreren og sætter sig i højrepositionen.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(69, 121, "STOP - sit foran - kort vej rundt - STOP", "Teamet stopper, og hunden sætter sig i venstrepositionen. Derefter dirigerer føreren hunden ind foran sig, hvor hunden sætter sig (med front mod føreren). I øvelsens anden del dirigeres hunden til venstrepositionen ved at gå den korte vej rundt til venstreposition med front mod føreren. Først når hunden sidder i venstreposition, går teamet atter fremad. Føreren må ikke flytte sig for at hjælpe hunden under øvelsen. Højrehandling gennemføres ved, at hunden dirigeres ind foran, hvor den sætter sig foran føreren, og afsluttes ved at hunden går den korte vej direkte til højrepositionen og sætter sig.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(70, 122, "Stå foran - bagom rundt", "Under gang dirigeres hunden ind foran, hvor den skal stå med front mod føreren, idet føreren stopper. Hunden dirigeres bagom rundt om føreren, og kommer direkte ind i venstrepositionen uden, at hunden sætter sig, hvorefter teamet fortsætter fremad. Føreren må ikke flytte fødderne, mens hunden går rundt om fører. Højrehandling gennemføres ved at hunden dirigeres ind foran i stå, og afsluttes ved at hunden går venstre rundt og bag om føreren til højrepositionen.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(71, 123, "Stå foran - kort vej rundt", "Under gang dirigeres hunden ind foran, hvor den skal stå med front mod føreren, idet føreren stopper. Hunden dirigeres den korte vej rundt direkte ind i venstrepositionen uden, at hunden sætter sig, hvorefter teamet fortsætter fremad. Føreren må ikke flytte fødderne, mens hunden går rundt om fører. Højrehandling gennemføres ved, at hunden dirigeres ind foran i stå og afsluttes ved, at hunden dirigeres den korte vej højre rundt direkte til højrepositionen.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(72, 124, "STOP - dæk - sit", "Teamet stopper, og hunden sætter sig i venstrepositionen. Når hunden sidder, dirigeres hunden direkte i dæk, og derefter direkte i sit. Føreren må ikke flytte sig under øvelsen. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(73, 125, "STOP - stå - gå rundt", "Teamet stopper, og hunden sætter sig i venstrepositionen. Hunden skal derefter stå og blive stående, mens føreren går til venstre og rundt den. Teamet fortsætter med hunden direkte fra stå. Højrehandling gennemføres ved, at føreren går højre ind foran og rundt om hunden, som står i højreposition uden at røre sig. Teamet fortsætter med hunden direkte fra stå.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(74, 126, "STOP - 1 skridt stå, 1 skridt sit, 1 skridt dæk", "Teamet stopper, og hunden sætter sig i venstrepositionen. Teamet går 1 skridt, stopper, hunden står stille. Teamet går 1 skridt, stopper, hunden sætter sig. Teamet går 1 skridt, stopper, hunden lægger sig, dernæst fortsætter teamet fremad med hunden i venstrepositionen direkte fra dæk. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(75, 127, "STOP - hund foran rundt - STOP", "Teamet stopper, og hunden sætter sig i venstrepositionen. Hunden dirigeres til at bytte side fra venstre til højre, foran føreren og med front mod denne, direkte til sit i højrepositionen. Højrehandling gennemføres ved, at hunden bytter side fra højre til venstre, foran øreren og med front mod denne, direkte til sit i venstrepositionen.", DefaultHandlingPositionEnum.ChangeOfPosition, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(76, 128, "STOP - hund bagved rundt - STOP", "Teamet stopper, og hunden sætter sig i venstrepositionen. Hunden dirigeres til at bytte side fra venstre til højre, bagved føreren og med front mod denne, direkte til sit i højreposition. Højrehandling gennemføres ved, at hunden bytter side fra højre til venstre, bagved fører og med front mod denne, direkte til sit i venstrepositionen.", DefaultHandlingPositionEnum.ChangeOfPosition, true, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(77, 129, "Springvand", "Foran skiltet ændrer teamet retning ved at dreje væk fra hinanden og fortsætte i modsat retning, således at hunden bytter side fra venstre til højre. Dette skal ske samtidigt, i en flydende bevægelse og uden stop. Højrehandling gennemføres på samme måde ved, at fører og hund drejer væk fra hinanden, hvorved hunden bytter side fra højre til venstre.", DefaultHandlingPositionEnum.ChangeOfPosition, false, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(78, 130, "To tyskervendinger", "Før skiltet passeres og med hunden i venstrepositionen, går føreren venstre omkring, mens hunden går højre om rundt om føreren til venstrepositionen. Føreren tager herefter 1 - 3 skridt med hunden i venstreposition, før der foretages endnu en vending, og teamet fortsætter i den oprindelige retning. Vendingerne skal ske samtidigt og uden stop. Højrehandling gennemføres ved, at føreren går højre omkring, mens hunden går venstre om. Hunden fortsætter i højreposition.", DefaultHandlingPositionEnum.Optional, false,false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(79, 131, "Cirkel i gang omkring fører", "Før skiltet passeres og med hunden i venstrepositionen dirigeres hunden til at gå en gang højre rundt om føreren, og komme tilbage i venstrepositionen, mens føreren fortsætter sin gang fremad uden stop. Højrehandling gennemføres ved, at hunden går en gang venstre rundt om føreren tilbage til Højreposition, mens føreren fortsætter sin gang fremad uden stop. Hunden fortsætter i højreposition.", DefaultHandlingPositionEnum.Optional, false, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(80, 132, "Hund snur ind mod fører", "Før skiltet passeres dirigeres hunden til at snurre en gang rundt, ind imod føreren, og komme tilbage i venstrepositionen, mens føreren fortsætter sin gang fremad. Højrehandling gennemføres ved, at før skiltet passeres dirigeres hunden til at snurre en gang rundt, ind imod føreren, og komme tilbage i højrepositionen, mens føreren fortsætter sin gang fremad. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, false, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(81, 133, "2 skridt baglæns - hunden bakker", "Med hunden i venstreposition skifter føreren retning ved at bakke mindst 2 skridtlængder uden at stoppe op, herefter fortsætter teamet fremad. Hunden bakker med føreren og holder sin position under hele øvelsen uden at sætte sig. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, false, false, null, LevelEnum.Advanced),
            new ExerciseDataAccessModel(82, 200, "STOP - spring - ro - spring - STOP", "Teamet stopper før springet, og hunden sætter sig i venstrepositionen. Føreren bliver stående, mens hunden springer over springet uden at rive ned, stoppes på modsat side i en selvvalgt position, på signal springer hunden tilbage over springet uden at rive ned og sætter sig direkte i venstrepositionen. Teamet fortsætter herfra i banens retning. Højrehandling gennemføres på samme måde. Hunden holder højreposition.", DefaultHandlingPositionEnum.Optional, true, false, JumpEnum.DoubleJump, LevelEnum.Expert),
            new ExerciseDataAccessModel(83, 201, "Dæk - bliv - alm. gang - forbi 1 spring", "Teamet stopper, og hunden dirigeres direkte i dæk. Hunden bliver liggende, mens føreren går forbi springet. Næste skilt skal være indkald. Idet fører dirigerer, springer hunden over springet uden at rive ned og søger direkte ind i venstreposition. Højrehandling gennemføres på samme måde. Hunden holder højreposition.", DefaultHandlingPositionEnum.Optional, true, false, JumpEnum.SingleJump, LevelEnum.Expert),
            new ExerciseDataAccessModel(84, 202, "Dæk - bliv - løb - forbi 1 spring", "Teamet stopper, og hunden dirigeres direkte i dæk. Hunden bliver liggende, mens føreren løber forbi springet. Næste skilt skal være indkald. Idet fører dirigerer, springer hunden over springet uden at rive ned og søger direkte ind i venstreposition. Højrehandling gennemføres på samme måde. Hunden holder højreposition.", DefaultHandlingPositionEnum.Optional, true, false, JumpEnum.SingleJump, LevelEnum.Expert),
            new ExerciseDataAccessModel(85, 203, "Stå - bliv - alm. gang - forbi 1 spring", "Teamet stopper, og hunden dirigeres direkte i stå. Hunden bliver stående, mens føreren går forbi springet. Næste skilt skal være indkald. Idet fører dirigerer, springer hunden over springet uden at rive ned og søger direkte ind i venstreposition. Højrehandling gennemføres på samme måde. Hunden holder højreposition.", DefaultHandlingPositionEnum.Optional, true, false, JumpEnum.SingleJump, LevelEnum.Expert),
            new ExerciseDataAccessModel(86, 204, "Stå - bliv - løb - forbi 1 spring", "Teamet stopper, og hunden dirigeres direkte i stå. Hunden bliver stående, mens føreren løber forbi springet. Næste skilt skal være indkald. Idet fører dirigerer, springer hunden over springet uden at rive ned og søger direkte ind i venstreposition. Højrehandling gennemføres på samme måde. Hunden holder højreposition.", DefaultHandlingPositionEnum.Optional, true, false, JumpEnum.SingleJump, LevelEnum.Expert),
            new ExerciseDataAccessModel(87, 205, "STOP - gå hen og læg dig", "Under gang drejer teamet i retning mod feltet, hvor teamet stopper, og hunden sætter sig ned i venstrepositionen. Når hunden sidder i venstrepositionen, dirigeres den til at løbe frem til feltet og lægge sig med størstedelen af kroppen inden for dette. Herefter fortsætter føreren fremad. Hunden bliver liggende, indtil indkald, der skal være næste øvelse. Højrehandling gennemføres på samme måde. Hunden holder højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(88, 206, "STOP - stå - dæk", "Teamet stopper, og hunden sætter sig i venstrepositionen. Derefter dirigeres hunden op at stå. Herefter dirigeres hunden i dæk, og til sidst fortsætter teamet fremad med hunden i venstrepositionen direkte fra dæk. Føreren må ikke flytte sig under øvelsen. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(89, 207, "STOP - stå - sit", "Teamet stopper, og hunden sætter sig i venstrepositionen. Derefter dirigeres hunden op at stå. Herefter dirigeres hunden i sit, hvorefter teamet fortsætter fremad. Føreren må ikke flytte sig under øvelsen. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(90, 208, "STOP - hent/bring", "Teamet stopper, og hunden sætter sig i venstrepositionen og bliver siddende, mens føreren går fra den og kommer tilbage igen. En Hent-øvelse skal efterfølges af en Bring-øvelse. Hunden skal holde venstrepositionen mellem de to øvelser. Højrehandling gennemføres på samme. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(91, 209, "Stå - hent/bring", "Teamet stopper, og hunden dirigeres til at blive stående i venstreposition og blive stående helt stille, mens føreren går fra den og kommer tilbage igen. En Hent-øvelse skal efterfølges af en Bring-øvelse. Hunden skal holde venstrepositionen mellem de to øvelser. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(92, 210, "Dæk - hent/bring", "Teamet stopper, og hunden dirigeres direkte i dæk uden at sætte sig først og bliver liggende, mens føreren går fra den og kommer tilbage igen. En Hent-øvelse skal efterfølges af en Bring-øvelse. Hunden skal holde venstrepositionen mellem de to øvelser. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(93, 211, "STOP - gå fra", "Teamet stopper, og hunden sætter sig i venstrepositionen og bliver siddende, mens føreren går fra den. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(94, 212, "Stå - gå fra", "Teamet stopper, og hunden dirigeres til at blive stående, idet føreren stopper. Hunden bliver stående, mens føreren går fra den. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(95, 213, "Dæk - gå fra", "Teamet stopper, og hunden dirigeres direkte i dæk uden at sætte sig først og blive liggende, mens føreren går fra den. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(96, 214, "Stå under gang - gå rundt", "Fra gang og uden at tøve får føreren hunden til at blive stående og går venstre rundt ind foran og omkring hunden. Hunden fortsætter direkte fra stå. Højrehandling gennemføres ved, at føreren går højre rundt ind foran og omkring hunden. Hunden fortsætter i højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(97, 215, "3 skridt baglæns - hunden bakker", "Med hunden i venstreposition skifter føreren retning ved at bakke mindst 3 skridtlængder uden at stoppe op, herefter fortsætter teamet fremad. Hunden bakker med føreren og holder sin position under hele øvelsen uden at sætte sig. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, false, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(98, 216, "Stå foran - hund bak 1 længde - fremad", "Hunden dirigeres ind foran, hvor den skal stå med front mod føreren. Hunden dirigeres derefter til at bakke, mens føreren bliver stående. Når den har bakket mindst 1 hundelængde, går føreren fremad, mens hunden bliver stående, overhaler hunden og får den ind i venstreposition. Det er valgfrit om det sker til højre eller venstre, men skal ske i en flydende bevægelse. Højrehandling gennemføres på samme måde. Hunden samles op til højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(99, 217, "Dobbelt 180° vending - højre rundt - venstre rundt", "Før skiltet passeres og med hunden i venstrepositionen laver teamet en højre 180° vending. Føreren tager herefter 2-3 skridt med hunden i position, før der foretages endnu en 180° vending, denne gang til venstre. Hunden skal være i venstreposition under hele øvelsen, og denne foretages uden stop. Teamet fortsætter i den oprindelige retning. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, false, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(100, 218, "Dobbelt 180° vending - venstre rundt - højre rundt", "Før skiltet passeres og med hunden i venstrepositionen laver teamet en venstre 180° vending. Føreren tager herefter 2-3 skridt med hunden i position, før der foretages endnu en 180° vending, denne gang til højre. Hunden skal være i venstreposition under hele øvelsen og denne foretages uden stop. Teamet fortsætter i den oprindelige retning. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, false, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(101, 219, "STOP - 3 sideskridt højre - STOP", "Teamet stopper efter skiltet, og hunden sætter sig i venstrepositionen. Føreren træder 3 sideskridt lige til højre (uden at ændre retning). Hunden følger med i venstreposition. Idet føreren stopper, sætter hunden sig igen i venstreposition, hvorefter teamet fortsætter til næste øvelse. Kan ikke udføres i højrehandling.", DefaultHandlingPositionEnum.Left, true, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(102, 220, "STOP - 3 sideskridt venstre - STOP", "Teamet stopper efter skiltet, og hunden sætter sig i højrepositionen. Føreren træder 3 sideskridt lige til venstre (uden at ændre retning). Hunden følger med i højreposition. Idet føreren stopper, sætter hunden sig igen i højreposition, hvorefter teamet fortsætter til næste øvelse. Kan ikke udføres i venstrehandling.", DefaultHandlingPositionEnum.Right, true, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(103, 221, "3 sideskridt til højre", "Føreren træder 3 sideskridt lige til højre (uden at ændre retning). Hunden følger med i venstreposition, hvorefter teamet fortsætter til næste øvelse. Kan ikke udføres i højrehandling.", DefaultHandlingPositionEnum.Left, false, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(104, 222, "3 sideskridt til venstre", "Føreren træder 3 sideskridt lige til venstre (uden at ændre retning). Hunden følger med i højreposition, hvorefter teamet fortsætter til næste øvelse. Kan ikke udføres i venstrehandling.", DefaultHandlingPositionEnum.Right, false, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(105, 223, "Cirkel i gang om fører - 90° højre", "Lige før skiltet skal hunden under gang gå en venstre cirkel ind foran og rundt om føreren, mens føreren laver en 90° drejning til højre. Øvelsen kan ikke laves i venstrehandling.", DefaultHandlingPositionEnum.Right, false, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(106, 224, "Cirkel i gang om fører - 90° venstre", "Lige før skiltet skal hunden under gang gå i en cirkel om føreren, mens føreren laver en 90° drejning til venstre. Øvelsen kan ikke laves i højrehandling.", DefaultHandlingPositionEnum.Left, false, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(107, 225, "Sideskift bagved", "Før skiltet passeres og med hunden i venstrepositionen dirigeres hunden til at bytte side bagved føreren til højreposition, mens føreren holder banelinjen. Dette skal ske i en flydende bevægelse uden stop. Højrehandling gennemføres også bagved føreren, og hunden ender i venstreposition.", DefaultHandlingPositionEnum.ChangeOfPosition, false, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(108, 226, "8 tal med sideskift bagved", "Teamet skal gå et helt 8-tal, hvorved de passerer centrum 3 gange. Anden gang centrum passeres, laves et sideskift bagved, så hunden ender i højreposition. Hunden regulerer sit tempo efter føreren. Højrehandling gennemføres på samme måde. Hunden starter i højreposition, laver sideskift bagved og ender i venstreposition.", DefaultHandlingPositionEnum.ChangeOfPosition, false, true, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(109, 227, "Kløverblad med fristelser", "Teamet skal gå en kløverbladsform, hvorved de passerer midten 4 gange. Hunden holder venstrepositionen, uden at fristelserne berøres. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, false, true, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(110, 228, "Indkald til modsat side under gang", "I øvelsesområdet kalder føreren på hunden, som skal komme direkte til den gående position på modsat side i forhold til forrige øvelse. Føreren må ikke ændre tempo under øvelsen, men fortsætter til den næste øvelse med hunden i position. Højrehandling gennemføres på samme måde.", DefaultHandlingPositionEnum.ChangeOfPosition, false, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(111, 229, "Med sideskift", "Føreren afslutter øvelserne 200, 208, 209, 210, 216, 309 og 311 med hunden i modsat position af, hvordan øvelsen startede. Føreren starter øvelse 1 med hunden i højreposition. Dette er et tillægsskilt og tæller ikke med i det samlede antal øvelser på banen.", DefaultHandlingPositionEnum.ChangeOfPosition, false, false, null, LevelEnum.Expert),
            new ExerciseDataAccessModel(112, 300, "Sideskift foran", "Før skiltet passeres og med hunden i venstrepositionen dirigeres hunden til at bytte side foran føreren til venstreposition, mens føreren holder banelinjen. Skiftet skal ske i en flydende bevægelse uden stop. Højrehandling gennemføres også foran føreren. Hunden ender i venstreposition.", DefaultHandlingPositionEnum.ChangeOfPosition, false, false, null, LevelEnum.Champion),
            new ExerciseDataAccessModel(113, 301, "90° venstre - sideskift med kegle", "Under gang dirigeres hunden, med uret rundt om keglen, mens føreren drejer 90° venstre, og hunden ender i højreposition. Øvelsen kan ikke udføres i højrehandling.", DefaultHandlingPositionEnum.Left, false, true, null, LevelEnum.Champion),
            new ExerciseDataAccessModel(114, 302, "90° højre - sideskift med kegle", "Under gang dirigeres hunden, mod uret rundt om keglen, mens føreren drejer 90° højre om, og hunden ender i venstreposition. Øvelsen kan ikke udføres i venstrehandling.", DefaultHandlingPositionEnum.Right, false, true, null, LevelEnum.Champion),
            new ExerciseDataAccessModel(115, 303, "Tunnel", "Efter skiltet og direkte fra venstrepositionen dirigeres hunden gennem tunnelen, mens føreren fortsætter fremad uden opstandsning, afventning eller stop. Efter hundens passage fortsætter teamet til den næste øvelse med hunden i venstreposition. Højrehandling gennemføres på samme måde. Hunden returnerer til højreposition.", DefaultHandlingPositionEnum.Optional, false, false, null, LevelEnum.Champion),
            new ExerciseDataAccessModel(116, 304, "STOP - 1, 2 skridt baglæns - hund bakker - STOP", "Teamet stopper, og hunden sætter sig i venstrepositionen. Føreren tager 1 skridt baglæns, mens hunden holder venstrepositionen ved at rejse sig, bakke og sætte sig igen. Føreren tager 2 skridt baglæns, mens hunden holder venstrepositionen ved at rejse sig, bakke og sætte sig igen, før teamet igen fortsætter fremad. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Champion),
            new ExerciseDataAccessModel(117, 305, "STOP - 1 skridt baglæns stå - 1 skridt baglæns sit - 1 skridt baglæns dæk", "Teamet stopper, og hunden sætter sig i venstrepositionen. Teamet bakker 1 skridt, stopper, hunden står stille. Teamet bakker 1 skridt, stopper, hunden sætter sig i venstreposition. Teamet bakker 1 skridt, stopper, hunden lægger sig og til sidst fortsætter teamet fremad med hunden i venstrepositionen direkte fra dæk. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Champion),
            new ExerciseDataAccessModel(118, 306, "STOP - 1 skridt baglæns stå - 2 skridt baglæns sit - 3 skridt baglæns dæk", "Teamet stopper, og hunden sætter sig i venstrepositionen. Teamet bakker 1 skridt, stopper, hunden står stille. Teamet bakker 2 skridt, stopper, hunden sætter sig i venstreposition. Teamet bakker 3 skridt, stopper, hunden lægger sig og til sidst fortsætter teamet fremad med hunden i venstrepositionen direkte fra dæk. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Champion),
            new ExerciseDataAccessModel(119, 307, "2 skridt baglæns - 90° højre - 2 skridt baglæns", "Med hunden i venstreposition skifter føreren retning ved at bakke mindst 2 skridtlængder uden at stoppe op, herefter drejer teamet 90° højre og bakker mindst 2 skridtlængder uden at stoppe. Teamet fortsætter herefter fremad. Hunden bakker med føreren og holder sin position under hele øvelsen uden at sætte sig. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, false, false, null, LevelEnum.Champion),
            new ExerciseDataAccessModel(120, 308, "2 skridt baglæns - 90° venstre - 2 skridt baglæns", "Med hunden i venstreposition skifter føreren retning ved at bakke mindst 2 skridtlængder uden at stoppe op, herefter drejer teamet 90° venstre og bakker mindst 2 skridtlængder uden at stoppe. Teamet fortsætter herefter fremad. Hunden bakker med føreren og holder sin position under hele øvelsen uden at sætte sig. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, false, false, null, LevelEnum.Champion),
            new ExerciseDataAccessModel(121, 309, "Stå foran - hund bak 3 længder - fremad", "Under gang dirigerer føreren hunden ind foran sig, hvor den skal stå med front mod føreren. Hunden dirigeres derefter til at bakke, mens føreren bliver stående. Når den har bakket mindst 3 hundelængder, går føreren videre fremad, overhaler hunden og får den i venstreposition. Det er valgfrit om det sker til højre eller venstre, men skal ske i en flydende bevægelse. Højrehandling gennemføres på samme måde. Hunden samles op til højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Champion),
            new ExerciseDataAccessModel(122, 310, "Send over 2 spring", "Efter skiltet og direkte fra venstrepositionen dirigeres hunden til at springe fremad over springene uden at rive ned, mens føreren fortsætter fremad uden opstandsning, afventning eller stop. Teamet fortsætter til den næste øvelse med hunden i venstreposition. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, false, false, JumpEnum.DoubleJump, LevelEnum.Champion),
            new ExerciseDataAccessModel(123, 311, "STOP - Dobbeltspring - ro - spring - STOP", "Teamet stopper, før springene, og hunden sætter sig i venstrepositionen. Føreren bliver stående, mens hunden springer over springene uden at rive ned, stoppes på modsat side i en selvvalgt position. På signal springer hunden tilbage over begge spring uden at rive ned og sætter sig direkte i venstrepositionen. Teamet fortsætter herfra i banens retning. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, false, false, JumpEnum.DoubleJump, LevelEnum.Champion),
            new ExerciseDataAccessModel(124, 312, "STOP - bliv - løb frem - forbi 2 spring", "Teamet stopper og hunden sætter sig i venstrepositionen. Hunden bliver siddende, mens føreren løber forbi springene. Næste øvelse skal være et indkald. Hunden dirigeres over begge spring uden at rive ned og direkte ind i venstreposition. Højrehandling gennemføres på samme måde. Hunden fortsætter i højreposition.", DefaultHandlingPositionEnum.Optional, true, false, JumpEnum.DoubleJump, LevelEnum.Champion),
            new ExerciseDataAccessModel(125, 313, "Stå - bliv - alm. gang - forbi 2 spring", "Teamet stopper, og hunden dirigeres direkte i stå, idet føreren stopper. Hunden bliver stående, mens føreren går forbi 2 spring. Næste øvelse skal være et indkald. Hunden dirigeres over begge spring uden at rive ned, og direkte ind i venstrepositionen. Højrehandling gennemføres på samme måde. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, JumpEnum.DoubleJump, LevelEnum.Champion),
            new ExerciseDataAccessModel(126, 314, "Stå - bliv - løb - forbi 2 spring", "Teamet stopper og hunden dirigeres direkte i stå, idet føreren stopper. Hunden bliver stående, mens føreren løber forbi 2 spring. Næste øvelse skal være et indkald. Hunden dirigeres over begge spring uden at rive ned og direkte ind i venstreposition. Højrehandling gennemføres på samme måde. Hunden fortsætter i højreposition.", DefaultHandlingPositionEnum.Optional, true, false, JumpEnum.DoubleJump, LevelEnum.Champion),
            new ExerciseDataAccessModel(127, 315, "STOP - send frem - stå", "Under gang drejer teamet i retning mod keglen, før hunden sætter sig i venstrepositionen. Når hunden sidder, dirigeres den til at løbe frem til en afvigende kegle og stå (indenfor 1 meter fra keglen). Herefter fortsætter føreren fremad. Næste øvelse skal være et indkald. Højrehandling gennemføres på samme måde. Hunden sendes fra højreposition.", DefaultHandlingPositionEnum.Optional, true, true, null, LevelEnum.Champion),
            new ExerciseDataAccessModel(128, 316, "Dobbelt 8 tal med sideskift bagved", "Teamet skal gå 2 gange et 8-tal, hvorved de passerer midten 5 gange. Ved 3. passage af midten udføres et sideskift bagved. Hunden holder venstreposition, indtil sideskift, hvorefter der fortsættes i højreposition. Højrehandling gennemføres på samme måde. Hunden holder højreposition, indtil sideskift, hvorefter der fortsættes i venstreposition.", DefaultHandlingPositionEnum.ChangeOfPosition, false, true, null, LevelEnum.Champion),
            new ExerciseDataAccessModel(129, 317, "Sit under gang - Gå rundt", "Fra venstrepositionen og uden at tøve får føreren hunden til at sætte sig og går venstre ind foran og omkring hunden. Højrehandling gennemføres ved, at føreren går højre rundt ind foran og omkring hunden. Hunden fortsætter i højrepositionen.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Champion),
            new ExerciseDataAccessModel(130, 318, "Dæk under gang - Gå rundt", "Fra venstrepositionen og uden at tøve får føreren hunden til at dække og går venstre ind foran og omkring hunden. Hunden fortsætter direkte fra dæk. Højrehandling gennemføres ved, at føreren går højre ind foran og omkring hunden. Hunden fortsætter i højrepositionen direkte fra dæk.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Champion),
            new ExerciseDataAccessModel(131, 319, "STOP - 90° venstre om stå - 90° venstre om sit - 90° venstre om dæk", "Teamet stopper, og hunden sætter sig i venstrepositionen. Derefter drejer teamet på stedet, 90° til venstre. Hunden følger med og holder sin venstreposition, bliver stående i venstrepositionen. Teamet drejer 90° til venstre, hvor hunden følger med og sætter sig i venstrepositionen. Teamet drejer yderligere 90° til venstre, hvor hunden følger med og holder sin venstrepositionen, og hunden dækker, hvorefter teamet fortsætter til næste øvelse. Højrehandling gennemføres også til venstre. Hunden holder hele tiden højreposition.", DefaultHandlingPositionEnum.Optional, true, false, null, LevelEnum.Champion),
